  array('id' => '6','title' => 'Sheikh Hasina distributed a cheque of Taka one lak','image' => '1465733499.4935.jpg','video' => '','position_id' => '2','category_id' => '3','user_id' => '5','blog' => '<p>Sheikh Hasina distributed a cheque of Taka one lakh and a medal to each of 24 such students who scored best in the competitions in 2015 and 2016 under a government initiative title &lsquo;Srijanshil Medha Onneshan&rdquo; (Searching Creative Talents] launched in 2013.</p>

<p><br />
