  array('id' => '20','title' => 'These Are the U.S. Airlines That Will Take You to ','image' => '1465733847.976.jpg','video' => '','position_id' => '1','category_id' => '6','user_id' => '5','blog' => '<p>Six airlines just received permission from the Department of Transportation to resume commercial flights to Cuba this fall.</p>

<p>For the first time in more than five decades, American Airlines, Frontier Airlines, JetBlue, Southwest, Sun Country, and Silver Airways (a relatively new regional carrier based in Florida) will begin operating nonstop flights between the U.S. and the island nation 90 miles south of Florida.</p>

<p>We&rsquo;ve been&nbsp;<a href="http://www.travelandleisure.com/articles/us-airlines-flight-routes-cuba" target="_blank">waiting since March</a>&nbsp;to hear which U.S. airlines scored the coveted routes to Cuba. Noticeably, major legacy carriers Delta and United were not awarded any routes, though the DOT has yet to announce who will be granted access to the capital, Havana.</p>
